<head>
    <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css">
    <style>
        @font-face {
            font-family: 'Gotham';
            src: url('/static/fonts/Gotham-Medium.otf');
            font-weight: 400;
            font-style: normal;
        }

        html {
            background: #F2F2F2;
        }

        body {
            position: relative;
        }

        .containers {
            background: #FFFFFF 0% 0% no-repeat padding-box;
            box-shadow: 0px 0px 23px #0080F917;
            border-radius: 24px;
            max-width: 100%;
            height: 100%;
            margin: auto;
            display: block;
            margin-top: 6%;

        }

        .cards {
            display: inline-block;
        }

        .card-inputs {
            padding-top: 15px;
        }

        .card-num-input {
            display: flex;
            margin: auto;
        }

        .card-num {
            background-image: url('data:image/png;base64,') !important;
            background-origin: content-box;
            background-repeat: no-repeat;
            background-position: right;
        }

        .card-num-input input {
            padding: 10px 10px;
            width: 100%;
            border-radius: 10px;
            box-shadow: 1px 2px 5px whitesmoke;
            margin-bottom: 0.5rem;
            border: 1px solid #B5CFE8;
            border-radius: 15px;
            opacity: 1;
            height: 25px;
            font-size: 18px;
            color: #7F98C5;
            font-weight: 300;
            font-family: "Gotham";
        }

        .card-num-input input::placeholder,
        .input-containers input::placeholder {
            text-align: left;
            font-size: 18px;
            font-weight: 300;
            font-family: "Gotham";
            letter-spacing: 0px;
            color: #7F98C5;
            opacity: 1;
        }

        .card-num-input input:focus,
        .card-num-input input:hover,
        .input-containers input:focus,
        .input-containers input:hover {
            border: 1px solid #1782FB;
            border-radius: 15px;
            outline: none;
        }

        .input-containers {
            display: flex;
            justify-content: space-between;
            margin: auto;
            width: 100%;
            text-align: center;
        }

        .input-containers input {
            width: calc(50% - 5px);
            display: inline-block;
            padding: 20px 10px;
            border-radius: 10px;
            box-shadow: 1px 2px 5px whitesmoke;
            margin-bottom: 0.5rem;
            border: 1px solid #B5CFE8;
            border-radius: 15px;
            height: 25px;
            font-size: 18px;
            color: #7F98C5;
            font-weight: 300;
            font-family: "Gotham";
            box-sizing: border-box;
            margin: 0px !important;
        }

        .input-containers input:first-child {
            margin-right: 0.5rem;
        }

        #number {
            margin-top: 1rem;
        }

        .jp-card {
            margin-top: 1rem;
            min-width: 0px !important;
            min-height: 247px !important;
        }

        .jp-card .jp-card-front,
        .jp-card .jp-card-back {
            background-image: url('data:image/png;base64,') !important;
            margin: auto;
            background-position: top right !important;
            background-size: cover !important;
            line-height: 1;
            width: 100% !important;
            height: 100% !important;
            background-origin: content-box !important;
        }

        .visa-logo {
            width: 40%;
            float: left;
            text-align: left;
            padding-left: 1rem;
            margin-top: 1rem;
        }

        .bg {
            float: right;
        }

        .bg-path {
            position: absolute;
            height: 170px;
        }

        .companyName {
            width: 40%;
            text-align: center;
            margin-right: 2rem;
            margin-top: 1rem;
            position: relative;
            padding-left: 1rem;
        }

        .card-icon {
            width: 36%;
            float: left;
            text-align: right;
            padding-right: 1rem;
            margin-top: 1rem;
        }

        .cardNum {
            width: 100%;
            float: left;
            text-align: left;
            padding-left: 1.3rem;
            margin-top: 1rem;
        }

        .cardNum span {
            text-align: left;
            font-size: 16px;
            font-weight: 300;
            font-family: 'Gotham';
            letter-spacing: 0px;
            color: #01338D;
            margin-bottom: 0.5rem;
            display: block;
        }

        .cardNum p {
            text-align: left;
            font-size: 25px;
            font-weight: 300;
            font-style: normal;
            font-family: 'Gotham';
            color: #FFFFFF;
            margin: auto;
            letter-spacing: 2.88px;
            opacity: 1;
        }

        .section3 {
            margin-bottom: 1rem;
            margin-top: 1rem;
        }

        .Name {
