        }

        .jp-card .jp-card-front .jp-card-lower .jp-card-expiry:before,
        .jp-card .jp-card-front .jp-card-lower .jp-card-name:before {
            font-weight: 300 !important;
            font-style: normal;
            font-family: 'Gotham' !important;
            font-size: 11px !important;
            color: #01338D !important;
            margin-bottom: 0.5rem !important;
            opacity: 1 !important;
        }

        .jp-card .jp-card-front .jp-card-lower .jp-card-name {
            width: 50% !important;
            text-transform: none !important;
        }

        .jp-card .jp-card-front .jp-card-lower .jp-card-number:before {
            content: attr(data-before);
            margin-bottom: 2px;
            font-size: 7px;
            text-transform: uppercase;
            font-weight: 300 !important;
            font-style: normal;
            font-family: 'Gotham' !important;
            font-size: 11px !important;
            display: inline-grid;
            width: 100%;
            letter-spacing: 0.58px !important;
            color: #01338D !important;
            margin-bottom: 0.5rem !important;
            opacity: 1 !important;
        }

        .jp-card .jp-card-front .jp-card-lower .jp-card-name:before {
            content: attr(data-before);
            margin-bottom: 2px;
            font-size: 7px;
            text-transform: uppercase;
            font-weight: 300 !important;
            font-style: normal;
            font-family: 'Gotham' !important;
            font-size: 11px !important;
            display: inline-grid;
            width: 100%;
            letter-spacing: 0.58px !important;
            color: #01338D !important;
            margin-bottom: 0.5rem !important;
            opacity: 1 !important;
        }

        .jp-card .jp-card-front .jp-card-lower {
            left: 6% !important;
        }

        .jp-card .jp-card-front .jp-card-lower .jp-card-name,
        .jp-card .jp-card-front .jp-card-lower .jp-card-expiry {
            font-weight: 300 !important;
            font-style: normal;
            text-transform: none;
            font-family: 'Gotham' !important;
            font-size: 14px !important;
            letter-spacing: 0px !important;
            color: #FFFFFF !important;
            opacity: 0.37;
        }

        .jp-card-paymob {
            position: absolute;
            opacity: 0;
            right: 10px !important;
            top: 15px;
            -webkit-transition: 400ms;
            -moz-transition: 400ms;
            transition: 400ms;
        }

        .jp-card-display.jp-card-paymob::before,
        .jp-card-display.jp-card-paymob::after {
            display: block;
            position: relative;
        }

        .jp-card .jp-card-front .jp-card-display,
        .jp-card .jp-card-back .jp-card-display {
            opacity: 1 !important;
        }

        .jp-card-display.jp-card-paymob::before {
            content: url('data:image/png;base64,');
            width: 100%;
            position: relative;
            height: 100%;
            display: block;
            right: 5% !important;
            opacity: 1 !important;
        }

        .jp-card .jp-card-front .jp-card-shiny:before {
            background: none !important;
        }

        .jp-card .jp-card-front .jp-card-shiny {
            float: right;
            margin-right: -13% !important;
            position: absolute !important;
            top: 50px;
            left: 0px;
            background: url('data:image/png;base64,') no-repeat center center !important;
            background-size: 100% 100% !important;
            margin-top: -22%;
            position: none !important;
            width: 45px !important;
        }

        .jp-card .jp-card-front .jp-card-logo {
            left: 5% !important;
        }

        footer {
            width: 100%;
        }

        .card-footer {
            margin: auto;
            width: 100%;
            display: block;
            margin-top: 0.5rem;
            text-align: center;
        }

        .card-footer .submit {
            background: #1782FB 0% 0% no-repeat padding-box;
            border-radius: 11px;
            border: none;
            padding: 0px;
            text-align: center;
            font-family: 'Gotham';
            font-weight: 300;
            letter-spacing: 0px;
            color: #FFFFFF;
            /* display: block; */
            margin: auto;
            cursor: pointer;
            width: 100%;
            height: 45px;
            font-size: 19px;
            line-height: 45px;
            transition: all ease-in-out .3s;
        }

        .card-footer .submit:hover {
            transform: translateY(-2px);
            box-shadow: 2px 2px 6px #ccc;
        }

        .whiteBtn {
            background: transparent;
            border-radius: 11px;
            border: 1px solid #1782FB;
            padding: 0px;
            text-align: center;
            font-family: 'Gotham';
            font-weight: 300;
            letter-spacing: 0px;
            color: #1782FB;
            /* display: block; */
            margin: auto;
            cursor: pointer;
            width: 100%;
            height: 45px;
            font-size: 19px;
            line-height: 45px;
            transition: all ease-in-out .3s;
        }

        .whiteBtn:hover {
            background-color: #1782FB;
            color: #fff;
        }

        .card-footer span {
            text-align: center;
            font-size: 13px;
            font-family: 'Gotham';
            font-weight: 300;
            letter-spacing: 0px;
            color: #7F98C5;
            padding-top: 5px;
            display: block;
            padding-bottom: 10px;
        }

        .saveCardText {
            text-align: center;
            font-size: 13px;
            font-family: 'Gotham';
            font-weight: 300;
            letter-spacing: 0px;
            color: #7F98C5;
            display: block;
            padding-bottom: 1rem;
        }

        footer {
            padding-bottom: 1rem;
        }

        .copyWrite {
            margin: auto;
            margin-top: 30px;
        }

        .copyWrite img {
            display: block;
            margin: auto;
        }

        .copyWrite span {
            text-align: center;
            font-size: 12px;
            font-family: 'Gotham';
            font-weight: 300;
            font-style: normal;
            letter-spacing: 0px;
            color: #7F98C5;
            margin-top: 0.5rem;
            display: block;

        }

        @media only screen and (max-width: 600px) {
            .containers {
                width: 100%
            }

            .cards {
                width: 93%;
                margin-left: 15px;
                margin-right: 15px;
            }

            .card-inputs {
                width: 415px;
                max-width: 100%;
                padding-top: 0px;
                margin: auto;
            }

            .jp-card .jp-card-front .jp-card-shiny {
                display: block;
            }

            #paymob_checkout {
                padding: 0px 15px;
            }

            .arrow1 {
                display: none;
            }

            .arrow2 {
                display: none;
            }
        }

        /* Small devices (portrait tablets and large phones, 600px and up) */
        @media only screen and (min-width: 600px) {
            .containers {
                width: 70%;
            }

            .cards {
                width: 100%;
                float: none;
                margin: auto;
            }

            .card-inputs {
                width: 415px;
                max-width: 100%;
                margin: auto;
                padding-top: 0px;
            }

            .jp-card .jp-card-front .jp-card-shiny {
                display: block;
            }

            .arrow1 {
                display: none;
            }

            .arrow2 {
                display: none;
            }
        }

        @media only screen and (min-width: 768px) {
            .jp-card .jp-card-front .jp-card-shiny {
                display: block;
            }

            .card-inputs {
                width: 415px;
                max-width: 100%;
                margin: auto;
                padding-top: 15px;
            }
        }

        @media only screen and (min-width: 992px) {
            .cards {
                width: 49%;
                float: left;
                padding-left: 0.5rem;
                padding-top: 15px;
                padding-bottom: 1rem;
            }

            .jp-card .jp-card-front .jp-card-shiny {
                display: block;
            }

            .jp-card-container {
                float: left;
            }

            .jp-card {
                margin-top: 1rem;
                width: 415px !important;
                min-width: 415px !important;
                min-width: 0px !important;
            }

            .card-inputs {
                width: 46%;
                display: inline-block;
                padding-left: 1rem;
            }

            .containers {
                width: 880px;
                padding: 0rem 2rem;
            }

            .arrow1 {
                right: 3%;
                top: 0%;
                display: block;
            }

            .arrow2 {
                left: 2%;
                display: block;
                bottom: auto;
            }
        }

        #discountMessgae {
            display: none;
            text-align: center;
            font-size: 18px;
            font-family: 'Gotham';
            letter-spacing: 0px;
            color: #7F98C5;
            margin-bottom: 10px;
        }

        #submitButton:disabled {
            cursor: not-allowed;
            background-color: #E8E8E8;
            border: none;
            color: #fff;
        }

        #submitButtonWaiting {
            display: none;
        }

        #submitButtonWaiting>i {
            font-size: 20px;
        }

        .checkInstallmentTextDiv {
            display: none;
            width: 100%;
            height: 30px;
            padding: 0px 5px;
            box-sizing: border-box;
        }

        .checkInstallmentTextDiv p {
            display: inline-block;
            float: left;
            margin: 0px;
            font-size: 14px;
