        }

        .checkInstallmentTextDiv span:hover {
            cursor: pointer;
            text-decoration: underline;
        }

        @media only screen and (max-width: 600px) {
            .checkInstallmentTextDiv {
                width: 100%;
                height: 60px;
            }

            .checkInstallmentTextDiv p {
                text-align: center;
                display: block;
                width: 100%;
            }

            .checkInstallmentTextDiv span {
                text-align: center;
                display: block;
                width: 100%;
            }
        }

        .installmentsDiv {
            display: none;
            margin: 30px 0px;
        }

        .installmentsHead {
            text-align: center;
            margin-bottom: 15px;
        }

        .installmentsHead>img {
            height: 35px;
            width: auto;
            margin: auto;
        }

        .installmentsHead p {
            font-size: 20px;
            color: #01338D;
            margin: 0px;
        }

        #installmentsBody {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            padding: 0px 15px;
        }

        #installmentsBody .installmentsEle {
            display: inline-block;
            border: 2px solid #BFDFFD;
            border-radius: 15px;
            text-align: center;
            height: 50px;
            min-width: 150px;
            padding: 10px 0px;
            margin: 0px 7px;
            margin-bottom: 15px;
            transition: all ease-in-out .3s;
        }

        #installmentsBody .installmentsEle>p {
            line-height: 26px;
            font-size: 22px;
            color: #01338D;
            margin: 0px;
            margin-bottom: 5px;
        }

        #installmentsBody .installmentsEle>span {
            list-style: 18px;
            font-size: 15px;
            color: #0080F9;
        }

        #installmentsBody .installmentsEle.selected {
            border: 2px solid #0080F9;
        }

        #installmentsBody .installmentsEle:hover {
            cursor: pointer;
            border: 2px solid #0080F9;
        }


        #checkInstallmentBtn {
            display: none;
        }

        .formRowContainer {
            min-height: 300px;
        }

        .installmentsSubmitDiv {
            width: 100%;
            text-align: center;
            margin-top: 30px;
        }

        .installmentsSubmitDiv>input {
            background: #1782FB 0% 0% no-repeat padding-box;
            border-radius: 11px;
            border: none;
            padding: 0px;
            text-align: center;
            font-family: 'Gotham';
            font-weight: 300;
            letter-spacing: 0px;
            color: #FFFFFF;
            /* display: block; */
            margin: auto;
            cursor: pointer;
            width: 400px;
            max-width: 100%;
            height: 45px;
            font-size: 19px;
            line-height: 45px;
            outline: none !important;
            transition: all ease-in-out .3s;
        }

        .installmentsSubmitDiv>input:hover {
            transform: translateY(-2px);
            box-shadow: 2px 2px 6px #ccc;
        }

        .installmentsSubmitDiv>input:disabled {
            cursor: not-allowed;
            opacity: .4;
        }

        .copyWrite .logos {
            text-align: center;
            margin-top: 25px;
        }

        .copyWrite .logos>img {
